INSERT INTO `catalogo_productos` (`idsystemcatpro`, `catalogo_productos_sku`, `catalogo_tipoproductos_idsystemtipopro`, `empresa_idsystemEmpresa`, `categorias_programasonline_idsystemcatproon`, `producto_modalidad_idsystemprodmod`, `catalogo_productos_idMdl`, `catalogo_productos_idprospectus`, `catalogo_productos_nombre`, `catalogo_productos_duracion`, `catalogo_productos_descripcioncorta`, `catalogo_productos_descripcionlarga`, `catalogo_productos_esquemacursos`, `catalogo_productos_incluye`, `catalogo_productos_link`, `catalogo_productos_thumbfacilitador`, `catalogo_productos_namefacilitador`, `catalogo_productos_positionfacilitador`, `catalogo_productos_nameBlogNote`, `catalogo_productos_dateBlogNote`, `catalogo_productos_nameFailitadorBlogNote`, `catalogo_productos_linkBlogNote`, `catalogo_productos_fechainicio`, `catalogo_productos_fechafin`, `presencial_direccion`, `presencial_linklocation`, `virtual_notas`, `virtual_link`, `catalogo_productos_iva`, `catalogo_productos_preciomx`, `catalogo_productos_preciousd`, `catalogo_productos_preciomx_descuento`, `catalogo_productos_preciousd_descuento`, `descuentos_idsystemdescuento`, `catalogo_productos_file_folleto`, `catalogo_productos_file_thumb`, `catalogo_productos_thumb_encabezado`, `catalogo_productos_file_promocion`, `catalogo_productos_publicado`, `catalogo_productos_stock`, `catalogo_productos_fechacreacion`, `contacto`) VALUES
(1, 'DCT101', 1, 1, 1, 2, 0, 0, 'Entrenamiento mental para deportistas: Autoconfianza', '6 horas', '<div>¿Alguna vez te dijeron que tenes que tener más confianza? ¿Alguna vez, te dijeron cómo? En este curso veremos múltiples ejercicios para mejorar la AUTOCONFIANZA.</div>', '<div style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);color:rgb(0, 0, 0);font-family:Verdana, Arial, Helvetica, sans-serif;font-size:13.3333px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">La práctica de la “atención plena”, la meditación, cada vez es más practicada por los deportistas porque permite desarrollar mayor control sobre uno mismo así como mejorar la concentración y el estar presente en el momento preciso. Tarea realmente necesaria cuando queremos rendir en nuestro deporte y tener éxito.<br>&nbsp;</div><div style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);color:rgb(0, 0, 0);font-family:Verdana, Arial, Helvetica, sans-serif;font-size:13.3333px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><strong>Temario:</strong></div><div style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);color:rgb(0, 0, 0);font-family:Verdana, Arial, Helvetica, sans-serif;font-size:13.3333px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">&nbsp;</div><div style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);color:rgb(0, 0, 0);font-family:Verdana, Arial, Helvetica, sans-serif;font-size:13.3333px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">A. La mente.</div><div style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);color:rgb(0, 0, 0);font-family:Verdana, Arial, Helvetica, sans-serif;font-size:13.3333px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">B. Autoconfianza.</div><div style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);color:rgb(0, 0, 0);font-family:Verdana, Arial, Helvetica, sans-serif;font-size:13.3333px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">C. Respiración y relajación.</div><div style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);color:rgb(0, 0, 0);font-family:Verdana, Arial, Helvetica, sans-serif;font-size:13.3333px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">D. Ejercicios: evidencia del pasado.</div><div style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);color:rgb(0, 0, 0);font-family:Verdana, Arial, Helvetica, sans-serif;font-size:13.3333px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">E. Ejercicios: la mente en el presente.</div><div style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);color:rgb(0, 0, 0);font-family:Verdana, Arial, Helvetica, sans-serif;font-size:13.3333px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">F. Ejercicios: la mente en el futuro.</div><div style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);color:rgb(0, 0, 0);font-family:Verdana, Arial, Helvetica, sans-serif;font-size:13.3333px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">G. LLegando al final: la meta.<br>&nbsp;</div><div style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);color:rgb(0, 0, 0);font-family:Verdana, Arial, Helvetica, sans-serif;font-size:13.3333px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;let