os/cursos_talleres/banners/DCT102_blog.png,', 0, 10, '2023-08-30 18:21:06', '{\"whats\":\"0101001010\",\"tel\":\"0101001010\",\"email\":\"correogeneric@gmail.com\"}'),
(3, 'DCT103', 1, 1, 2, 1, 0, 0, 'Retiro del Guerrero Permacultor | 30% descuento pronto pago', '40 Horas', '<p>Entre otros temas en este retiro, compartimos: sistema curativo por dieta amucosa, permacultura y chamanismo, emprender desde el servicio, disciplinas toltecas, prácticas de: pases mágicos, breathworking, ensueño y recapitulación Temazcal.</p>', '<p>Entre otros temas en este retiro, compartimos: sistema curativo por dieta amucosa, permacultura y chamanismo, emprender desde el servicio, disciplinas toltecas, prácticas de: pases mágicos, breathworking, ensueño y recapitulación Temazcal.</p><p><strong>Nuestras premisas en este retiro:</strong></p><p>Yo soy mi propia Guerra.<br>Yo soy mi propia Medicina.</p><p>También te recolectarás con tu camino con corazón. Comenzarás a vaciarte, para poder llenarte de una vida plena. Ofrecemos las herramientas necesarias para que recuperes el poder que tienes para crear tu propia realidad.</p><p>Las circunstancias parecen dominar nuestra vida, pero realmente somos nosotros los que coreamos el mundo. Te empoderamos para que logres crear realidad propia, lograr el máximo de salud, paz, equilibrio, abundancia. Practicamos lo que enseñamos, Granja Tequio es el medio perfecto para subir tu nivel de consciencia.</p><p><strong>Temario:</strong></p><p>- Sistema Curativo por Dieta Amucosa, para cambiar nuestra vida primero debemos vaciarnos.Deja de alimentar a tus parásitos para limpiar tu cuerpo y que logre todo su potencial.</p><p>- Conceptos del Guerrero Permacultor, nuestra vida se plasma desde lo sutil, trabajaremos internamente (zona 00 de Permacultura) para llegar a niveles altos de consciencia.</p><p>- Camino con Corazón, Tener una vida significativa implica que tu camino tenga corazón,emprender desde el servicio. levantarte todos los días para disfrutar lo que haces</p><p>- Breathworking, conectando conscientemente con el subconsciente y el supraconsciente.La respiración es la herramienta más poderosa para aumentar nuestro nivel de consciencia y conectar con nuestra poderosa naturaleza.</p><p>- Herramientas Iniciáticas, un Guerrero es la suma de su poder personal: ejercicios de Disciplinas Toltecas, acecho, recapitulación, pases mágicos, ensueño. La energía se mueve a partir de mi intención.</p><p>- Sueño consciente, compartimos varias herramientas para jugar en el mundo cuántico: lo sútil es más poderoso que lo denso. con menos energía y tiempo podemos conectar con nuestro mejor futuro posible.</p><p><strong>Calendario del retiro:</strong></p><p><strong>.:: Primera sesión (Miercoles) de 11 a 20 hrs. ::.&nbsp;</strong><br>Comida SCDA<br>Intro SCDA<br>Conceptos guerrero permacultor<br>Breathworking<br>Comida SCDA<br>Recapitulación</p><p><strong>.:: Segunda sesión (Jueves) de 9 a 20 hrs ::.</strong><br>Breathworking<br>Dialogo apreciativo<br>Camino con corazón<br>Breathworking<br>Recapitulación<br>Comida SCDA<br>Ensueño</p><p><strong>.:: Tercera sesión (Viernes) de 10 a 20 hrs::.</strong><br>Día de Ayuno<br>Breathworking<br>Pases Mágicos<br>Ensueño<br>Caminata de poder.<br>Breathworking<br>Pases Mágicos<br>Shankaprakshalana</p><p><strong>.:: Cuarta sesión (Sábado) de 9 a 19 hrs ::.</strong><br>Breathworking<br>Pases Mágicos<br>Comida SCDA<br>Herramientas iniciáticas<br>Temazcal<br>Comida SCDA</p><p><strong>.:: Quinta sesión (Domingo) de 9 a 15 hrs ::.</strong><br>Breathworking<br>Pases Mágicos<br>Comida SCDA<br>Cierre del Guerrero Permacultor</p><p><strong>Incluye:</strong></p><p>- Estadía en habitaciones compartidas hechas de materiales naturales (es posible rentar habitación privada con un costo extra).<br>- 7 comidas de limpieza y transición (No Mocoproductoras) con productos orgánicos de Granja Tequio.<br>- Información sobre los diferentes temas (liga en nubea), así como teoría en nuestra aula de bioconstrucción con vista a nuestro estanque natural y bosque comestible.<br>- Prácticas en los espacios naturales así como otras actividades de: temazcal, breathworking, recapitulación, pases mágicos y ensueño.</p><p>- Sistema Curativo por Dieta Amucosa, para cambiar nuestra vida primero debemos vaciarnos.</p>', '', '<p>También te recolectarás con tu camino corazón. Comenzarás a vaciarte, para poder llenarte de una vida plena. Ofrecemos las herramientas necesarias para que recuperes el poder que tienes para crear tu propia realidad.</p>', '', '/archivos/cursos_talleres/profile/DCT103_profile.png,', 'Ke´ Pani Barceló - Permacultor y Arquitecto', '', '', '', '', '', '2024-04-06', '2024-04-10', 'Direccion Generica', '#', '', '', 0.16, 4200, 0, 0, 0, NULL, '', '/archivos/cursos_talleres/thumbs/DCT103_thumbs01.,', '/archivos/cursos_talleres/banners/DCT103_banner01.png,', '', 1, 20, '2023-08-30 20:22:11', '{\"whats\":\"\",\"tel\":\"\",\"email\":\"\"}'),
(4, 'DCT104', 1, 1, 4, 1, 0, 0, 'Diplomado Diseño en Permacultura | 30% descuento pronto pago', '60 Horas', '<p>La permacultura es un sistema de diseño para la creación de paisajes productivos para satisfacer las necesidades del humano, imitando y regenerando a la naturaleza y regeneradora.&nbsp;</p>', '<p>La permacultura es un sistema de diseño para la creación de paisajes productivos para satisfacer las necesidades del humano, imitando y regenerando a la naturaleza y regeneradora. La permacultura nos permite caminar hacia la reconexión con nuestro ser original, caminar hacia La Naturaleza que reside en nosotros mismos. Este curso está enfocado en los pasos básicos, pero esenciales para tener los cimientos exitosos de tu paraíso: productivo, regenerativo, resiliente y saludable de Permacultura.<br><br>Hemos integrado los conocimientos de tres cursos, para tu proyecto de vida: Diseño de permacultura, Escala de permanencia y Agricultura orgánica. Aprende a diseñar tu espacio de salud, abundancia y belleza. Si quieres transitar de la sociedad de consumo al mundo del productor consiente y sustentable. Si tienes un terreno en el cual te has imaginado cosechando salud.&nbsp;<br>Logra la mayor cantidad de productos útiles: comida, agua, madera, medicina, fibras, etc. Sin la necesidad de depender de insumos externos. Siendo lo más autosuficiente posible, pero incrementando las conexiones beneficiosas con el exterior.<br><br>Este diplomado te mostrará como transformar un terreno: devolverle la fertilidad, volverlo productivo con baja inversión y crear abundancia de productos sanos con un mínimo de insumos externos.<br>&nbsp;</p><p><strong>Temario:</strong></p><p><strong>I. Introducción a la Permacultura (Febrero 16 al 18,2024):</strong></p><p>Recorreremos 3 proyectos exitosos y en pleno funcionamiento de Permacultura, para aprender y vivir lo que es la Permacultura: Historia, principios éticos, principios de diseño, flor de la permacultura, Herramientas de diseño.<br><br><strong>II. Diseño de agua (Abril 5 a 7,2024):</strong></p><p>Lo primero que podemos diseñar es el agua: paramos la erosión, captamos agua de lluvia y la expandimos por todo nuestro terreno, para crear nichos de vida y regeneración.<br><br><strong>III. Regeneración de suelos (Mayo 3 a 5,2024):</strong></p><p>Aprenderas practicando a regenerar un suelo aplicándolas 3 “m” minerales, microorganismos y materia orgánica. Todo lo necesario para que el suelo de tu proyecto sea ideal para la vida.<br><br><strong>IV. Bosques comestibles (Junio 7 a 9, 2024):</strong></p><p>En esos nichos aprenderás a diseñar bosques lineales para obtener un rendimiento de productos necesarios para satisfacer. El bosque comestible es el sistema de menor consumo energético para la mayor productividad.</p><p><strong>V. Estanques naturales (Julio 26 a 28,2024):</strong></p><p>Aprenderemos sobre el movimiento, el ciclo y el almacenamiento del agua para mantener el ciclo natural con el ambiente.<br><br><strong>VI. Plan maestro (Octubre 23 a 25,2024):</strong></p><p>Al final aprenderás a ubicar los elementos de tu diseño de manera que se beneficien entre ellos. Logrando la mayor producción con la menor inversión.&nbsp;</p><p><strong>Lo que incluye:</strong></p><p>- Estadía en habitaciones compartidas (es posible rentar habitación privada con un costo extra).<br>- Comidas ovolactovegetariana con productos orgánicos de Granja Tequio. Preparados en estufa ahorradora de leña.<br>- Información sobre los diferentes módulos (compartiremos liga de internet).<br>- Información teórica en nuestra aula de Bioconstrucción con vista a nuestro bosque comestible.<br>- Vive en un espacio exitoso de Permacultura: Granja Tequio durante una semana.<br>- Disfrutar el espacio de Vida Permacultural de Granja Tequio.</p><p>Preguntas frecuentes, a través de la siguiente liga https://bit.ly/3PUI5sU</p>', '', '<p>Este curso está enfocado en los pasos básicos, pero esenciales para tener los cimientos exitosos de tu paraíso: productivo, regenerativo, resiliente y saludable de Permacultura.&nbsp;</p>', '', '/archivos/cursos_talleres/profile/DCT104_profile.png,', ' Ke´ Pani Barceló - Permacultor y Arquitecto ', '', '', '', '', '', '2024-02-16', '2024-11-24', '#', '#', '', '', 0.16, 13000, 0, 0, 0, NULL, '', '/archivos/cursos_talleres/thumbs/DCT104_thumbs01.png,', '/archivos/cursos_talleres/banners/DCT104_banner01.png,', '', 0, 10, '2023-08-30 22:15:04', '{\"whats\":\"\",\"tel\":\"\",\"email\":\"\"}'),
(5, 'DCT105', 1, 1, 2, 2, 0, 0, 'Aguas Abiertas Bajío', '10:00 - 14:00 Hrs', '<p>Normas de información financiera, &nbsp;Balance general, Estado de resultados, entre otros.</p>', '<p><strong>Temario:</strong></p><p>1. Normas de información financiera: Marco conceptual, Revisión general de las normas particulares</p><p>2. Balance general: Estructura, Corto y largo plazo, Capital de trabajo, Activo, Pasivo y Capital</p><p>3. Estado de resultados</p><p>4. Estructura: Resultado operativo, Resultado integral de financiamiento e Impuesto a la utilidad</p><p>5. Estado de flujo de efectivo, Estructura, Hoja de trabajo e Interpretación.</p><p>6. Análisis de Estados Financieros: Horizontal, Vertical, Dupont y Mapa de Navegación</p>', '', '<p>El objetivo de este programa es proporcionar a los participantes las herramientas necesarias que les permitan comprender los estados financieros básicos.</p>', '', '/archivos/cursos_talleres/profile/DCT105_profile.png,', 'MTRO. CARLOS RAMÍREZ SÁNCHEZ', '', '', '', '', '', '2024-07-21', '2024-07-21', '', '', '#', '#', 0.16, 0, 0, 0, 0, NULL, '', '/archivos/cursos_talleres/thumbs/DCT105_thumbs01.png,', '/archivos/cursos_talleres/banners/DCT105_banner01.png,', '/archivos/cursos_talleres/banners/DCT105_blog.png,', 0, 29, '2023-09-06 16:29:02', '{\"whats\":\"222 444 8598\",\"tel\":\"22 233 5081\",\"email\":\"marketing@carpey.mx\"}'),
