(7, 'DCT107', 1, 1, 1, 2, 0, 0, 'Certificado en Nutrición Deportiva', '24 horas', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Verdana, Arial, Helvetica, sans-serif;font-size:13.3333px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Estudia nutrición deportiva y logra optimizar la selección de los&', '<div>En este espacio de capacitación aprenderás sobre propiedades de los grupos de alimentos relacionados al deporte, en sus distintas etapas de la preparación física.</div><div>&nbsp;</div><div><strong>Temario:</strong></div><div>&nbsp;</div><div>A. Plato del buen comer.</div><div>B. ¿Qué consume el cuerpo mientras te mueves?</div><div>C. Nutrición aplicada al deporte.</div><div>D. Mediciones calóricas y gasto calórico.</div><div>E. Tips de ajuste para uso personal.<br>&nbsp;</div><div>Incluye además materiales digitales y acceso a plataforma virtual por dos semanas.</div><div>Link video: <a href=\"https://youtu.be/_QKoOeSXm1g\" target=\"_blank\">https://youtu.be/_QKoOeSXm1g</a></div>', '', '<p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:Verdana, Arial, Helvetica, sans-serif;font-size:13.3333px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Aprender sobre el tipo de alimentos y nutrición que usa un deportista de alto rendimiento según los tiempos de su planeación. Este curso esta orientado a Profesionales de las ciencias de la salud, estudiantes y graduados de programas afines.</span></span></p>', '', '/archivos/cursos_talleres/profile/DCT107_profile.png,', 'Arnulfo Gomez Viera - Médico y nutriólogo de la Selección Nacional', '', '', '', '', '', '2024-08-03', '2024-08-05', '', '', '#', '#', 0.16, 1900, 0, 0, 0, NULL, '', '/archivos/cursos_talleres/thumbs/DCT107_thumbs01.png,', '/archivos/cursos_talleres/banners/DCT107_banner01.png,', '/archivos/cursos_talleres/banners/DCT107_blog.png,', 0, 19, '2024-02-21 23:13:13', '{\"whats\":\"2221145556\",\"tel\":\"2221145556\",\"email\":\"atencion@piquero.com.mx\"}'),
